import React, { useState } from 'react';
import Canvas from './Canvas';
import axios from 'axios';

const PRESET_ROLES = [
  { role: '自己', icon: '🧑' },
  { role: '父亲', icon: '👨' },
  { role: '母亲', icon: '👩' },
  { role: '孩子', icon: '🧒' },
  { role: '祖父', icon: '👴' },
  { role: '祖母', icon: '👵' },
];

function App() {
  const [members, setMembers] = useState(() => {
    const saved = localStorage.getItem('members');
    return saved ? JSON.parse(saved) : [];
  });
  const [name, setName] = useState('');
  const [role, setRole] = useState('');
  const [icon, setIcon] = useState('🧑');
  const [analysis, setAnalysis] = useState('');
  const [loading, setLoading] = useState(false);

  React.useEffect(() => {
    localStorage.setItem('members', JSON.stringify(members));
  }, [members]);

  const addMember = () => {
    if (!name || !role) return;
    setMembers([...members, { id: Date.now(), name, role, icon, x: 100, y: 100 }]);
    setName('');
    setRole('');
    setIcon('🧑');
  };

  const quickAdd = (preset) => {
    setRole(preset.role);
    setIcon(preset.icon);
    setName('');
  };

  const updateMemberPosition = (id, x, y) => {
    setMembers(members.map(m => m.id === id ? { ...m, x, y } : m));
  };

  const generateDescription = () => {
    if (members.length === 0) return '';
    return members.map(m => `${m.name}（${m.role}）位于(${m.x}, ${m.y})`).join('，');
  };

  const analyze = async () => {
    setLoading(true);
    setAnalysis('');
    try {
      const description = generateDescription();
      const res = await axios.post('http://127.0.0.1:5000/analyze', { description });
      setAnalysis(res.data.analysis);
    } catch (e) {
      setAnalysis('分析失败，请稍后重试。');
    }
    setLoading(false);
  };

  const clearMembers = () => {
    setMembers([]);
    setAnalysis('');
  };

  return (
    <><div style={{ color: 'red', fontSize: 30 }}>测试App渲染</div><div className="min-h-screen bg-gray-50 p-4">
      <div className="max-w-2xl mx-auto bg-white rounded shadow p-6">
        <h1 className="text-2xl font-bold mb-4">家庭成员排列分析</h1>
        <div className="flex gap-2 mb-2 flex-wrap">
          {PRESET_ROLES.map(preset => (
            <button
              key={preset.role}
              className="bg-gray-200 hover:bg-blue-200 px-2 py-1 rounded flex items-center gap-1"
              onClick={() => quickAdd(preset)}
            >
              <span>{preset.icon}</span>{preset.role}
            </button>
          ))}
        </div>
        <div className="flex gap-2 mb-4 items-center">
          <input
            className="border p-2 rounded flex-1"
            placeholder="姓名"
            value={name}
            onChange={e => setName(e.target.value)} />
          <input
            className="border p-2 rounded flex-1"
            placeholder="关系（如父亲、母亲、自己）"
            value={role}
            onChange={e => setRole(e.target.value)} />
          <select
            className="border p-2 rounded"
            value={icon}
            onChange={e => setIcon(e.target.value)}
          >
            {PRESET_ROLES.map(preset => (
              <option key={preset.role} value={preset.icon}>{preset.icon}</option>
            ))}
          </select>
          <button className="bg-blue-500 text-white px-4 py-2 rounded" onClick={addMember}>添加</button>
        </div>
        <Canvas members={members} updateMemberPosition={updateMemberPosition} />
        <div className="flex gap-2 mt-2">
          <button
            className="bg-green-500 text-white px-6 py-2 rounded"
            onClick={analyze}
            disabled={loading || members.length === 0}
          >
            {loading ? '分析中...' : '分析'}
          </button>
          <button
            className="bg-gray-300 text-gray-700 px-4 py-2 rounded"
            onClick={clearMembers}
            disabled={members.length === 0}
          >
            清空
          </button>
        </div>
        {analysis && (
          <div className="mt-6 p-4 bg-gray-100 rounded border border-gray-200">
            <div className="font-semibold mb-2">分析结果：</div>
            <div>{analysis}</div>
          </div>
        )}
      </div>
    </div></>
  );
}

export default App;
